import { Constants } from "../styles/Constants";
import { SerifTextS } from "../styles/TextStyles";

export const HistoryFormData = (data: any) => {
  return (
    <>
      <div
        style={{
          flexDirection: "column",
          backgroundColor: "red",
        }}
      >
        <SerifTextS style={{ textAlign: "left" }}>
          {Constants.forms.accessCode}
        </SerifTextS>
        <SerifTextS style={{ textAlign: "left" }}>{data.accessCode}</SerifTextS>
      </div>
    </>
  );
};
